import React from "react";
import {
  Container,
  Form,
  FormGroup,
  Label,
  Input,
  Button,
  Row,
  Col
} from "reactstrap";

import { useDispatch } from "react-redux";
import { registerUser } from "../Features/UserSlice";
import { useNavigate, Link } from "react-router-dom";
import { useForm } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import { userValidationsSchema } from "../Validation/UserValidation";
import '../App.css';
import backgroundImage from '../Images/backgroud.jpg';
const Register = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const {
    register, // React Hook Form register
    handleSubmit: submitForm,
    trigger,
    setValue,
    formState: { errors },
  } = useForm({
    resolver: yupResolver(userValidationsSchema),
  });

  const handleSubmit =  (data) => {
    try {
      const userData = {
        name:data.name,
        email: data.email,
        password: data.password,
      };
      console.log("Validation all good", data);
      alert("validation all good");
      // Dispatch the register action
      dispatch(registerUser(userData));

      console.log("User registered successfully", userData);

      // Navigate to login page
      navigate("/login");
    } catch (error) {
      console.error("Error during registration", error);
    }
  };


  return (
    <div
      className="register-background"
      style={{ backgroundImage: `url(${backgroundImage})` }}
    >
      <Container className="register-page py-4">
        <Row className="justify-content-center">
          <Col md={10} lg={8}>
            <h2 className="text-center register-title mb-4">Register for SaveWell</h2>
            <Form onSubmit={submitForm(handleSubmit)} autoComplete="off">

              <FormGroup>
                <Label for="name">Full Name</Label>
                <Input id="name" type="text" {...register("name")}  
              onChange={(e) => {
              setValue("name", e.target.value);
              trigger("name");
            }} placeholder="Enter your name" />
                <p className="text-danger">{errors.name?.message}</p>
              </FormGroup>

              <FormGroup>
                <Label for="email">Email</Label>
                <Input id="email" type="email" {...register("email")}  onChange={(e) => {
              setValue("email", e.target.value);
              trigger("email");
            }} placeholder="Enter your email" />
                <p className="text-danger">{errors.email?.message}</p>
              </FormGroup>

              <FormGroup>
                <Label for="password">Password</Label>
                <Input id="password" type="password" {...register("password")}  onChange={(e) => {
              setValue("password", e.target.value);
              trigger("password");
            }} placeholder="Enter your password" />
                <p className="text-danger">{errors.password?.message}</p>
              </FormGroup>

              <FormGroup>
                <Label for="confirmpassword">Confirm Password</Label>
                <Input id="confirmpassword" type="password" {...register("confirmpassword")} onChange={(e) => {
              setValue("confirmpassword", e.target.value);
              trigger("confirmpassword");
            }}  placeholder="Re-enter your password" />
                <p className="text-danger">{errors.confirmpassword?.message}</p>
              </FormGroup>


              <Button type="submit" className="button">Register</Button>

              <p className="mt-3 text-center">
                Already have an account? <Link to="/login">Login Here</Link>
              </p>
            </Form>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Register;
